import React from 'react'
import AdminLogin from './administrator/AdminLogin'
import 'bootstrap/dist/css/bootstrap.min.css';
import { Routes, Route } from 'react-router-dom'
import AdminPanel from './administrator/AdminPanel';
import Main from './Main';
import UpdateTrain from './administrator/UpdateTrain';

export default function App() {
  return (
    <>
      <Routes>
        <Route path='login-admin' index element={<AdminLogin />} />
        <Route path='/panel' element={<AdminPanel />} />
        <Route path='/update' element={<UpdateTrain />} />
      </Routes>

      {/* <Main/> */}


    </>
  )
}
